import React, { useState } from "react";

const App = () => {
  const [todos, setTodos] = useState([]);
  const addValue = (userValue) => {
    if (userValue) {
      const newItem = {
        id: Math.random().toString(36).substring(2.9),
        value: userValue
      }
      setTodos([...todos, newItem])
      console.log(newItem);
    }
  }

  return null
}

export default App ;
